 playful way. You will come away from this groundbreaking work with an understanding of how coding promotes developmentally appropriate experiences such as problem solving, imagination, cognitive challenges, social interactions, motor skills development, emotional exploration, and making different choices. Featuring all new case studies, vignettes and projects, as well as an expanded focus on teaching coding as a new literacy, this second edition helps you learn how to integrate coding into different curricular areas to promote literacy, math, science, engineering, and the arts through a project-based approach and a positive approach to learning.","industryIdentifiers":[{"type":"ISBN_10","identifier":"0367900505"},{"type":"ISBN_13","identifier":"9780367900502"}],"readingModes":{"text":false,"image":false},"pageCount":248,"printType":"BOOK","categories":["Computer programming"],"maturityRating":"NOT_MATURE","allowAnonLogging":false,"contentVersion":"preview-1.0.0","panelizationSummary":{"containsEpubBubbles":false,"containsImageBubbles":false},"imageLinks":{"smallThumbnail":"http://books.google.com/books/content?id=v4SGzQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api","thumbnail":"http://books.google.com/books/content?id=v4SGzQEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api"},"language":"en","previewLink":"http://books.google.com/books?id=v4SGzQEACAAJ&dq=programming&hl=&cd=8&source=gbs_api","infoLink":"http://books.google.com/books?id=v4SGzQEACAAJ&dq=programming&hl=&source=gbs_api","canonicalVolumeLink":"https://books.google.com/books/about/Coding_as_a_Playground.html?hl=&id=v4SGzQEACAAJ"},"saleInfo":{"country":"US","saleability":"NOT_FOR_SALE","isEbook":false},"accessInfo":{"country":"US","viewability":"NO_PAGES","embeddable":false,"publicDomain":false,"textToSpeechPermission":"ALLOWED","epub":{"isAvailable":false},"pdf":{"isAvailable":false},"webReaderLink":"http://play.google.com/books/reader?id=v4SGzQEACAAJ&hl=&source=gbs_api","accessViewStatus":"N